import React from 'react';
import {Context} from '../store/appContext.jsx';

export class MyAccount extends React.Component{
  render(){
    return(
        <div className="container" >
            <div className="row">
                <div className="col-12">
                    <h1>Hiding Under the NAV BAR</h1>
                </div>
                <h2> My Account</h2>
            </div>
            <div className=" p-5">
                <Context.Consumer>
                    {
                        ({store}) => {
                           if (store.session.loggedIn){
                            return (
                                <ul>
                                    <li>Hello {store.session.username}!</li>
                                    <li>{store.session.user.name}</li>
                                    <li>{store.session.user.email}</li>
                                    <div className="form-group container">
                                        <p>Exchanges to Watch</p>
                                        <div className="card">
                                            <div className="custom-control custom-checkbox mb-3">
                                                <input type="checkbox" className="custom-control-input" id="customCheck1"/>
                                                <label className="custom-control-label" for="customCheck1">CoinBase</label>
                                            </div>
                                            <div className="custom-control custom-checkbox mb-3">
                                                <input type="checkbox" className="custom-control-input" id="customCheck1"/>
                                                <label className="custom-control-label" for="customCheck1">Gemini</label>
                                            </div>
                                            <div className="custom-control custom-checkbox mb-3">
                                                <input type="checkbox" className="custom-control-input" id="customCheck1"/>
                                                <label className="custom-control-label" for="customCheck1">Mercado Bitcoin</label>
                                            </div>
                                            <div className="custom-control custom-checkbox mb-3">
                                                <input type="checkbox" className="custom-control-input" id="customCheck1"/>
                                                <label className="custom-control-label" for="customCheck1">Negocie Coins</label>
                                            </div>
                                            <div className="custom-control custom-checkbox mb-3">
                                                <input type="checkbox" className="custom-control-input" id="customCheck1"/>
                                                <label className="custom-control-label" for="customCheck1">BitCambio</label>
                                            </div>
                                            <div className="custom-control custom-checkbox mb-3">
                                                <input type="checkbox" className="custom-control-input" id="customCheck1"/>
                                                <label className="custom-control-label" for="customCheck1">Bitstamp</label>
                                            </div>
                                        </div>
                                    </div>
                                    <input className="btn btn-primary" type="submit" value="Update"/> 
                                </ul>

                                );
                        }
                    }
                }
                </Context.Consumer>           
                {/* <User data = {this.state[0]} */}

            </div>            
        </div>

        );
      }
}

export default MyAccount;
